Atomic update using complex multi-field expressions in MongoDB<p>I've been trying to figure out how to update a field in MongoDB using a complex expression.  The purpose of this is to atomically update the average voter score of a post when a user adds a vote, without having to store every vote and re-evaluate them every time.</p>
<p>The equation I am using is this:</p>
<pre><code>average = (size * average + value) / (size + 1);
</code></pre>
<p>And I converted this to what I thought was a MongoDB update expression, which SHOULD set the average and the size in a single atomic expression:</p>
<pre><code>db.Post.update({&quot;_id&quot;: id}, 
{ 
    $set: { 
        'average' : { 
            '$divide' : [ 
                { 
                    '$add' : [ 
                        { '$multiply' : [ 'size' , 'average' ] } , 
                        value 
                    ] 
                } , 
                { '$add' : [ 'size' , 1 ] } 
            ] 
        } , 
        'size' : { 
            '$add' : [ 'size' , 1 ] 
        } ,
        'total' : {
            '$add' : [ 'total' , value ]
        }
    } 
})
</code></pre>
<p>Apparently though, I don't know what I'm doing, because I got back the error:</p>
<pre><code>error: &quot;Cast to Number failed for value \&quot;{ '$add': [ 'total', 0.25 ] }\&quot; at path \&quot;total\&quot;&quot;
</code></pre>
<p>I tried searching around a bit more and adding dollar signs to the field names since apparently the $set syntax requires that, but that didn't help either, I got the same error.  Now I'm stuck.  Is there any way to convert a complex expression like this to a single MongoDB update?</p>

