Trouble with variable in Postman POST request<p>I am very new to coding, so my apologies if I use the wrong terms or am unclear. I have a list of 400+ words I need to be able to enter into my database. I found <a href="https://www.postman.com/postman/workspace/postman-answers/collection/9215231-25b72aab-2c6a-4941-832d-dd47e142ff2a?ctx=documentation" rel="nofollow noreferrer">this</a> collection to loop through my data and post it to the database. I am able to mostly get it to work, except for this one section (the meanings section) where it's an array of objects. If it makes a difference, this is for a React project and using MongoDB for the database.</p>
<p>Each word looks like this:</p>
<pre><code>{
  &quot;text&quot;: &quot;happy&quot;,
  &quot;traits&quot;: [
    &quot;wordlist100&quot;
  ],
  &quot;meanings&quot;: [
    {
      &quot;meaning&quot;: &quot;happy&quot;,
      &quot;category&quot;: &quot;default&quot;
    }
  ],
  &quot;approved&quot;: true,
  &quot;createdby&quot;: &quot;60dcd7ba69b1e52ac8138051&quot;,
  &quot;approvedBy&quot;: &quot;60dcd7ba69b1e52ac8138051&quot;,
  &quot;lastUserEdit&quot;: &quot;60dcd7ba69b1e52ac8138051&quot;,
  &quot;blocked&quot;: false
}
</code></pre>
<p>Where each word can have multiple traits and multiple meanings.</p>
<p>I have all the words in a JSON file, and am running it through Postman using the collection linked above. This is the body of my request in Postman:</p>
<pre><code>{
    &quot;text&quot;: &quot;{{text}}&quot;,
    &quot;traits&quot;: [
        &quot;{{traits}}&quot;
    ],
    &quot;meanings&quot;: [
        {
            &quot;meaning&quot;: &quot;{{meaning}}&quot;,
            &quot;category&quot;: &quot;{{category}}&quot;
        }
    ],
    &quot;approved&quot;: true,
    &quot;createdby&quot;: &quot;60dcd7ba69b1e52ac8138051&quot;,
    &quot;approvedBy&quot;: &quot;60dcd7ba69b1e52ac8138051&quot;,
    &quot;lastUserEdit&quot;: &quot;60dcd7ba69b1e52ac8138051&quot;,
    &quot;blocked&quot;: false
}
</code></pre>
<p>Using this, everything comes through correctly in my database except for the meaning and category of a word. This is what shows up in MongoDB:</p>
<pre><code>{
  &quot;_id&quot;: {&quot;$oid&quot;: &quot;6121bd6addff936ba4eb84bf&quot;},
  &quot;traits&quot;: [
    &quot;wordlist100&quot;
  ],
  &quot;text&quot;: &quot;happy&quot;,
  &quot;meanings&quot;: [
    {
      &quot;_id&quot;: {&quot;$oid&quot;: &quot;6121bd6addff936ba4eb84c0&quot;},
      &quot;meaning&quot;: &quot;{{meaning}}&quot;,
      &quot;category&quot;: &quot;{{category}}&quot;
    }
  ],
  &quot;approved&quot;: true,
  &quot;createdBy&quot;: {&quot;$oid&quot;: &quot;60dcd7ba69b1e52ac8138051&quot;},
  &quot;approvedBy&quot;: {&quot;$oid&quot;: &quot;60dcd7ba69b1e52ac8138051&quot;},
  &quot;lastUserEdit&quot;: {&quot;$oid&quot;: &quot;60dcd7ba69b1e52ac8138051&quot;},
  &quot;blocked&quot;: false,
  &quot;createdAt&quot;: {&quot;$date&quot;: &quot;2021-08-22T02:58:50.679Z&quot;},
  &quot;updatedAt&quot;: {&quot;$date&quot;: &quot;2021-08-22T02:58:50.679Z&quot;},
  &quot;__v&quot;: 0
}
</code></pre>
<p>What am I doing wrong with the meanings section of the word? I tried playing around with several combinations of brackets and such for how to set up the meanings part.</p>
<p>I did try:</p>
<pre><code>&quot;meanings&quot;: [
    &quot;{{meanings}}&quot;
]
</code></pre>
<p>...but that didn't work at all. Most of what I tried created an error that stopped the collection from running at all (it was probably bad syntax, as I said, I'm really new). This is the only arrangement that seems to get me close to right. Any help would be greatly appreciated.</p>
<p>Thanks!!</p>
