Update a field to be further nested in a document - MongoDB/Node<p>I am writing a migration with <a href="https://github.com/seppevs/migrate-mongo" rel="nofollow noreferrer">migrate-mongo</a> and the <a href="https://www.npmjs.com/package/mongodb" rel="nofollow noreferrer">Node driver for Mongo</a> which both have not-so-great documentation. I am trying to take a field and nest it one level further. Here is an example of the original structure:</p>
<pre><code>{
&quot;_id&quot;: {&quot;$oid&quot;:&quot;xxxxxxxx&quot;},
&quot;module&quot;: &quot;lalala&quot;,
&quot;settings&quot;: {
  &quot;yAxis&quot;: {
    &quot;title&quot;: {
      &quot;text&quot;: &quot;TITLE&quot;
    }
  }
}
</code></pre>
<p>I would like to take the yAxis field and its contents and nest it under a &quot;highcharts&quot; field so it ends up like this:</p>
<pre><code>&quot;settings&quot;: {
  &quot;highcharts&quot;: {
    &quot;yAxis&quot;: {
      &quot;title&quot;: {
        &quot;text&quot;: &quot;TITLE&quot;
      }
    }
  }
}
</code></pre>
<p>I saw this <a href="https://stackoverflow.com/questions/68304173/update-field-with-value-from-a-nested-field">Update field with value from a nested field</a> and was hoping I could use that $ operator to just take the yAxis contents and stick them back in but that isn't working. (The yAxis field now just reads the string literal '$settings.yAxis')</p>
<pre><code>async up(db) {
  const panels = db.collection('panels');
  await panels.updateMany({module: 'lalala'},
    {$set: {'settings.highcharts.yAxis': '$settings.yAxis'}});
  await panels.updateMany({module: 'lalala'},
    {$unset: {'settings.yAxis': ''}});
</code></pre>
<p>I also thought maybe I should iterate through the documents, parse them as JSON and grab the contents of yAxis, and insert that into a new 'highcharts' field, but that's using await in a forEach which doesn't work.</p>
<p>I ideally am doing this async so that I can do multiple operations in a single migration. Otherwise I would have to set the new 'highcharts' field in one migration and unset the old 'yAxis' in a different migration which could lead to problems if one fails but the other doesn't.</p>
<p>Somewhat stuck here, anything helps. Thanks!</p>

